import React, { useState, useEffect } from 'react';
import './animatieTitlu.css';

const FlyInText = () => {
  const [hidden, setHidden] = useState(true);

  useEffect(() => {
    const timer = setTimeout(() => {
      setHidden(false);
    }, 500);
    return () => clearTimeout(timer);
  }, []);

  return (
    <div>
      <ul className={`fly-in-text ${hidden ? 'hidden' : ''}`}>
        <li>B</li>
        <li>I</li>
        <li>N</li>
        <li>E</li>
        <li>A</li>
        <li>T</li>
        <li>I</li>
        <li>V</li>
        <li>E</li>
        <li>N</li>
        <li>I</li>
        <li>T</li>

      </ul>
    </div>
  );
};

export default FlyInText;
